def checkdivzero(Util):
    if Util == 1: Util=0.99999
    return Util
def calcostDL(Bandwidth,Utilization,Delay):
    if Delay ==0:
        Delay=0.0001
    Utilization = checkdivzero(Utilization)
    BandwidthWeight = 0.75
    DelayWeight = 0.25
    CurrentBandwidth = Bandwidth * (1-Utilization)
    # print('cur bw :',CurrentBandwidth)
    # print('curbw weight',BandwidthWeight*CurrentBandwidth)
    InvertedDelay = 1/Delay
    # print('i delay',InvertedDelay)
    # print('dl weight', DelayWeight*InvertedDelay)
    Cost = 1/(BandwidthWeight*CurrentBandwidth+DelayWeight*InvertedDelay)
    return Cost
def calcost_NonDL(Bandwidth,Utilization):
    Utilization=checkdivzero(Utilization)
    BandwidthWeight = 1
    DelayWeight = 0
    CurrentBandwidth = Bandwidth * (1 - Utilization)
    print('cur bw :',CurrentBandwidth)
    print('curbw weight',BandwidthWeight*CurrentBandwidth)
    InvertedDelay = 1 / 1
    print('dl*iv weight', DelayWeight * InvertedDelay)

    Cost = 1 / (BandwidthWeight * CurrentBandwidth + DelayWeight * InvertedDelay)
    return Cost
def couplelink(Edgelist):
    a=3
